import React from 'react';
import MyContext from './my_context.js';



const api = '/get-products'

class MyProvider extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            market_data: [],
        };
    }

    componentDidMount() {
        fetch(api)
        .then(
            res => {
                return res.json()
            }
        )
        .then(function(json_o) {
            this.setState({
                market_data: json_o.data
            })
        })
    }


    render() {
        return (
            <MyContext.Provider
                value={{
                    market_data: this.state.market_data,
                }}
            >
                {this.props.children}
            </MyContext.Provider>
        );
    }
}

export default MyProvider;
